import React from 'react';
//import {NavLink} from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.css';
import './LeadStatus.css';

const LeadStatus =() => {
    return(
        <div>
            <h2> This is lead  </h2>
            <p>Lead Status</p>
            <div className={'ls-topsection'}>
                <div className={"row"}>
                    <div className={"col-2 ml-auto"}>
                        <i className="zmdi zmdi-account-circle" style={{color: "bisque", fontSize: "1rem", marginLeft: "40%", marginRight: '-38.5%', display: "inline-block" }}> </i>
                         {/*add status dynamically {status} from backend*/}
                        <span>
                            <h4>Lead Status - </h4>
                            <h3 style={{ color: "lightblue"}}>Need to call</h3>
                        </span>
                    </div>
                    <div className={"col-2 mr-auto"}>
                        <button className={'topsection-btn'} style={{backgroundColor: "coral", borderRadius: "8%" }}> Update </button>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default LeadStatus;
